class Solution {
  bool increasingTriplet(List<int> nums) {
    
  int firstMin = 999999999999;
  int secondMin = 999999999999;

  for (int num in nums) {
    if (num <= firstMin) {
      firstMin = num;
    } else if (num <= secondMin) {
      secondMin = num;
    } else {
      return true;
    }
  }

    return false;
  }
}

